import React from "react";
import "./style.css";
import houses from "./houses";


const home = () => {
  function displayHouses() {
    const houseList = document.getElementById("houseList");
    houseList.innerHTML = "";
    houses.forEach((house, index) => {
      const houseCard = `
      <div class="col-sm-10 col-md-5 col-lg-3 col-xl-3 card" onclick="houseInfo(${index});">
              <img
                src="${house.img}"
                class="card-img-top"
                alt="..."
              />
              <div class="card-body">
                <div class="card-content">
                  <h5>${house.name}</h5>
                  <p>
                    ${house.desp}
                  </p>
                </div>
                <div class="card-btn text-end">
                  <button class="btn btn-outline-dark" onclick="houseInfo(${index});">Visit</button>
                </div>
              </div>
        </div>
      `;
      houseList.innerHTML += houseCard;
    });
  }

  function houseInfo(index) {
    window.location.href = `houseDetails.html?houseIndex=${index}`;
  }

  function getQueryParams() {
    const params = new URLSearchParams(window.location.search);
    return {
      houseIndex: params.get("houseIndex"),
    };
  }

  document.addEventListener("DOMContentLoaded", () => {
    const { houseIndex } = getQueryParams();
    const house = houses[houseIndex];
    if (house) {
      document.getElementById("house-name").textContent = house.name;
      document.getElementById("house-img").src = house.img;
      document.getElementById("house-img").alt = house.name;
      document.getElementById("house-desp").textContent = house.desp;
      document.getElementById("house-price").textContent = house.price;
      document.getElementById("house-area").textContent = house.area;
      document.getElementById("house-material").textContent = house.material;
      document.getElementById("house-landOptions").textContent =
        house.landOptions;
      document.getElementById("house-contractor-name").textContent =
        house.contractor.name;
      document.getElementById("house-contractor-contact").textContent =
        house.contractor.contact;
    } else {
      document.getElementById("house-name").textContent = "House not found";
    }
  });

  displayHouses();

  return (
    <>
      <main className="col-sm-12 col-md-12 col-lg-12 col-xl-12 main p-5">
        <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 text-center title-text pt-5">
          A complete solution for Planning & Designing your dream Home
        </div>
        <div className="container input-group input-group-lg mt-4 mb-5 px-5">
          <input
            type="text"
            className="form-control border border-dark py-3"
            placeholder="Enter your requirements..."
            aria-label="Enter your requirements..."
            aria-describedby="button-addon2"
          />
          <button
            className="btn btn-outline-dark"
            type="button"
            id="button-addon"
          >
            <i className="fa fa-search"></i>
          </button>
        </div>
        <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 d-flex justify-content-center px-4 gap-5">
          <span className="col-sm-1 col-md-1 col-lg-1 col-xl-1 fs-3">
            Find by
          </span>
          <span className="col-sm-2 col-md-2 col-lg-2 col-xl-2">
            <select
              id="designs"
              className="form-select"
              aria-label="Default select example"
            >
              <option selected>Designs</option>
              <option value="Penthouse">Penthouse</option>
              <option value="Bungalow">Bungalow</option>
              <option value="Farmhouses">Farmhouses</option>
              <option value="Villa">Villa</option>
              <option value="Cabin">Cabin</option>
            </select>
          </span>
          <span className="col-sm-2 col-md-2 col-lg-2 col-xl-2">
            <select
              id="price"
              className="form-select"
              aria-label="Default select example"
            >
              <option selected>Price Range</option>
              <option value="15-20 lakhs">15-20 lakhs</option>
              <option value="20-25 lakhs">20-25 lakhs</option>
              <option value="25-35 lakhs">25-35 lakhs</option>
              <option value="35-40 lakhs">35-40 lakhs</option>
            </select>
          </span>
          <span className="col-sm-2 col-md-2 col-lg-2 col-xl-2">
            <select
              id="area"
              className="form-select"
              aria-label="Default select example"
            >
              <option selected>Area Sq/Ft</option>
              <option value="300-500 sq/ft">300-500 sq/ft</option>
              <option value="1000-2000 sq/ft">1000-2000 sq/ft</option>
              <option value="1500-2500 sq/ft">1500-2500 sq/ft</option>
              <option value="2000-3000 sq/ft">2000-3000 sq/ft</option>
            </select>
          </span>
          <button
            id="findButton"
            className="col-sm-1 col-md-1 col-lg-1 col-xl-1 btn btn-outline-dark find-btn"
          >
            Find
          </button>
        </div>

        <div id="houseContainer" className="row"></div>

        <div className="container col-sm-12 col-md-12 col-lg-12 col-xl-12">
          <h3 className="pt-5">Popular Designs</h3>
          <div
            className="row gx-0 gap-5 mt-3 mx-auto justify-content-center"
            id="houseList"
          ></div>
        </div>
      </main>
    </>
  );
};

export default home;
